import React from 'react';
import { useEffect, useState } from 'react';
import logo from './logo.svg';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import './App.css';
import { Bar } from 'react-chartjs-2';

ChartJS.register(
  CategoryScale,
  LinearScale,
  BarElement,
  Title,
  Tooltip
);

interface graphInterface {
  id: number,
  velocity: number
}

interface graphVisuals {
  labels: [],
  datasets: []
}

function App() {

  const dta = [4, 5, 6]
  const [graph, setGraph] = useState<graphInterface[]>([])
  const [data, setData] = useState({
    labels: [1, 2, 3],
    datasets: dta.map(d => {
      const point = {
        label: d + ' Average Velocity',
        data: [d],
        backgroundColor: [
          'rgb(153, 102, 255)'
        ],
        borderColor: [
          'rgb(153, 102, 255)'
        ],
        borderWidth: 1
      }
      return point
    })
  });

  const test = 1

  useEffect(() => {
    fetch('http://127.0.0.1:8000/velocity/users')
      .then(response => response.json())
      .then(d => {
        setGraph(d);

        setData({
          labels: graph.map(point => point.id),
          datasets: graph.map(d => {
            const point = {
              label: d.id + ' Average Velocity',
              data: [d.velocity],
              backgroundColor: [
                'rgb(153, 102, 255)'
              ],
              borderColor: [
                'rgb(153, 102, 255)'
              ],
              borderWidth: 1,
              barPercentage: 1
            }
            return point
          })
        });

      });
  }, [test])

  const labels = graph.map(point => point.id)



  return (
    <div className="App">
      <header className="App-header">
        <Bar data={data} />
      </header>
    </div>
  );
}

export default App;
